var port;
var totitle		= document.createEvent('Event');
totitle.initEvent('to-title', true, true);


//和阅读页面沟通的时间准备

function fireCustomEvent(type) {
  	var hiddenDiv = document.getElementById('port_stub');
	switch(type){
		case 'to-title':
  			hiddenDiv.dispatchEvent(totitle);
			break;
		default:
	}
}


function main(){
	postHandle();
}

function postHandle(){
		//Add Elements in current page:
		//1. Stub for event
		//2. Stub for show
		$('.top-show-bar').remove();
		$('body').append("<div class='top-show-bar'></div>");
		$('.top-show-bar').click(function(){
			$(this).css('display','none');
		});

		port = chrome.extension.connect({name:'raw_page'});
		//port = chrome.extension.connect('nndomihejeomoigdjeganklacijoolgg',{name:'raw_page'});
		//port = chrome.extension.connect('fgijfppdmphfngnjchdcockmaekdlnji',{name:'raw_page'});
	  	port.onMessage.addListener(function(msg) {
			console.log(msg);
			switch(msg.message){
				case 'show message':
					showTip(msg.value); 
					break;
				case 'fetchContent':
					//如果是当前url
					if(msg.value == this.location.href){
						port.postMessage({message:"dataFetch",value:$('html').html()});	
						console.log('posted!!');
					} 
					break;
				default:
			}
		});
}



function showTip(value){
	console.log(value);
	$('.top-show-bar').css('display','block');
	$('.top-show-bar').html(value);
}

main();
